import NewBookForm from './components.js/NewBookForm';

class App extends Component {
  render(){
    return (

      <div className="App">
      <BookContextProvider>
        <Navbar/>
        <BookList/>
        <NewBookForm/>
      </BookContextProvider>

      </div>


    );
  }

}

export default App;
